import { useState } from "react";
import { CSVDownload } from "react-csv";

import "./App.css";

function App() {
  const [data, setData] = useState({});
  const [phone, setPhone] = useState();

  const handleChange = (event) => {
    setPhone(event.target.value);
  };

  const onSubmit = (e) => {
    e.preventDefault();
    fetch("http://localhost:80/randomphonenumbers", { phoneNumber: phone })
      .then((res) => res.json())
      .then((record) => setData(record));
  };

  const renderTableData = () => {
    return data?.result?.map((phone, index) => {
      return (
        <tr key={index}>
          <td>{index}</td>
          <td>{phone}</td>
        </tr>
      );
    });
  };

  const headers = () => {
    return data?.result?.map((phone, index) => {
      return [{ label: "Phone Number", key: index }];
    });
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Filtro para buscar telefonos</h1>
        <form onSubmit={onSubmit}>
          <label>Telefono: </label>
          <input type="number" onChange={handleChange} />
          <input type="submit" />
        </form>
        {data?.result && (
          <CSVLink data={[data?.result]} header={headers}>
            Download me
          </CSVLink>
        )}

        <table id="phones">
          <thead>
            <tr>
              <th>ID</th>
              <th>Phone Number</th>
            </tr>
          </thead>

          <tbody>{renderTableData()}</tbody>
        </table>
      </header>
    </div>
  );
}

export default App;
